import img1 from '../../images/img1.jpeg';
import img2 from '../../images/img2.jpeg';
import img3 from '../../images/img3.jpeg';
import img4 from '../../images/img4.webp';
import img5 from '../../images/img5.webp';
import img6 from '../../images/img6.webp';


const desc = 'This is the picture description';

export default [
    {id: 1, label: 'Furnace control board is fried!', imgSrc: img1 },
    {id: 2, label: 'New Trane high efficency furnace installed', imgSrc: img2 },
    {id: 3, label: 'Time for heat pump replacement!', imgSrc: img3 },
    {id: 4, label: 'New Evcon 407c condenser installed, ready to keep you cool!!', imgSrc: img4 },
    {id: 5, label: 'New Daikin mini split installed on old barn converted to garage', imgSrc: img5 },
    {id: 6, label: desc, imgSrc: img6 },

];
